-- ------------------------------ Table structure for pms_order_pay-- ----------------------------DROP TABLE IF EXISTS `pms_order_pay`;CREATE TABLE `pms_order_pay` (  `create_time` timestamp NULL DEFAULT NULL COMMENT '数据库记录产生时间',  `update_time` timestamp NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '数据库记录更新时间',  `order_id` varchar(50) NOT NULL COMMENT '后台生成的正式订单流水号，全局唯一',  `order_time` timestamp NULL DEFAULT NULL COMMENT '设备端顾客下单时间',  `order_pseudo_no` varchar(50) DEFAULT NULL COMMENT '设备端自建的非正式订单号',  `order_device_id` varchar(50) NOT NULL COMMENT '下单请求的来源设备id、在各自group中唯一',  `order_device_group` varchar(20) NOT NULL COMMENT '下单请求的来源设备所属类别或型号',  `order_total_fee` int(11) DEFAULT NULL COMMENT '订单总金额，单位为分，取整',  `order_status` varchar(20) NOT NULL COMMENT '下单状态',  `order_err_code` varchar(20) DEFAULT NULL COMMENT '下单错误代码',  `order_err_desc` varchar(50) DEFAULT NULL COMMENT '下单错误描述',  `pay_service` varchar(20) NOT NULL COMMENT '提供支付服务的三方名称',  `pay_status` varchar(20) NOT NULL COMMENT '支付状态',  `pay_err_code` varchar(20) DEFAULT NULL COMMENT '支付错误代码',  `pay_err_desc` varchar(50) DEFAULT NULL COMMENT '支付错误描述',  `sync_time` timestamp NULL DEFAULT NULL COMMENT '上次向三方查询、同步信息的时间',  `is_closed` tinyint(1) NOT NULL DEFAULT '0' COMMENT '订单是否处理完成：0-未处理完成 1-已处理完成已关闭',  `close_time` timestamp NULL DEFAULT NULL COMMENT '后台下单支付记录的关闭时间',  `remark` varchar(200) DEFAULT NULL,  PRIMARY KEY (`order_id`),  UNIQUE KEY `order_id` (`order_id`)) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='订单、支付状态表';
