-- ------------------------------ Table structure for pms_refund-- ----------------------------DROP TABLE IF EXISTS `pms_refund`;CREATE TABLE `pms_refund` (  `create_time` timestamp NULL DEFAULT NULL COMMENT '数据库记录产生时间',  `update_time` timestamp NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '数据库记录更新时间',  `order_id` varchar(50) NOT NULL COMMENT '后台生成的正式订单流水号，全局唯一',  `refund_no` varchar(50) NOT NULL COMMENT '后台生成的订单退款流水号，全局唯一，一个order_id可能有多个refund_no',  `refund_fee` int(11) NOT NULL COMMENT '一笔订单可能分多次退款，该栏位仅为某一笔退款申请的总金额，单位人民币/分取整',  `refund_status` varchar(20) NOT NULL COMMENT '退款状态',  `refund_err_code` varchar(20) DEFAULT NULL COMMENT '退款错误代码',  `refund_err_desc` varchar(20) DEFAULT NULL COMMENT '退款错误描述',  `sync_time` timestamp NULL DEFAULT NULL COMMENT '上次向三方查询、同步信息的时间',  `is_closed` tinyint(1) NOT NULL DEFAULT '0' COMMENT '该笔退款是否处理完成（结果可能成功或失败）',  `close_time` timestamp NULL DEFAULT NULL COMMENT '退款处理完成时间',  `remark` varchar(200) DEFAULT NULL COMMENT '备注',  PRIMARY KEY (`refund_no`),  KEY `order_id` (`order_id`),  CONSTRAINT `pms_refund_ibfk_1` FOREIGN KEY (`order_id`) REFERENCES `pms_order_pay` (`order_id`)) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='退款状态表';
