-- ------------------------------ Table structure for t_goods-- ----------------------------DROP TABLE IF EXISTS `t_goods`;CREATE TABLE `t_goods` (  `ID` int(11) NOT NULL AUTO_INCREMENT,  `GOODSNAME` varchar(30) NOT NULL COMMENT '名称',  `GOODSPICTURE` varchar(50) DEFAULT NULL COMMENT '图片',  `PRICE` double DEFAULT NULL COMMENT '价格',  `BRAND_ID` int(11) DEFAULT NULL COMMENT '品牌id',  `TYPE_ID` int(11) DEFAULT NULL COMMENT '类别id',  `PERSON` varchar(30) DEFAULT NULL COMMENT '适用人群',  `QUALITY_TIME` varchar(30) DEFAULT NULL COMMENT '保质期',  `INTRUDUCTION` text COMMENT '简介',  `REPLY_NUM` int(11) DEFAULT NULL COMMENT '评价数',  `BUY_NUM` int(11) DEFAULT NULL COMMENT '购买数',  `DISCOUNT` double DEFAULT NULL COMMENT '折扣',  `CREATE_TIME` datetime DEFAULT NULL COMMENT '上架时间',  `GOODS_NUM` int(11) DEFAULT NULL COMMENT '库存',  PRIMARY KEY (`ID`)) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8;
-- ------------------------------ Records of t_goods-- ----------------------------INSERT INTO `t_goods` VALUES ('1', '美人鱼', '1.png', '9', '1', '1', '周星驰', '邓超', '     轩的地产计划涉及填海工程，威胁靠海以为生的居民。背负家族秘密的珊被派遣前往阻止。二人在交手过程中互生情愫，虽然轩最终因为爱上珊而停止填海工作，但她因意外受伤而消失于大海。\n', '2', '0', '0', '2016-05-11 16:55:53', '0');INSERT INTO `t_goods` VALUES ('2', '三傻大闹好莱坞', '2.png', '8.9', '1', '1', '拉库马·希拉尼', '阿米尔', '影片采用插叙的手法，讲述了三位主人公法罕、拉加与兰彻间的大学故事。兰彻是一个与众不同的大学生，公然顶撞院长，并质疑他的教学方法，用智慧打破学院墨守成规的传统教育观念。兰彻的特立独行引起模范学生——绰号“消音器”的查尔图的不满，他们约定十年后再一决高下，然而毕业时兰彻却选择了不告而别[1]  。', '1', '0', '0', '2016-05-11 16:58:58', '0');INSERT INTO `t_goods` VALUES ('3', '美国队长3', '3.png', '9.5', '0', '5', '乔·卢素', '斯·埃文斯', '该片根据漫威2006年出版的漫画大事件《内战》改编，背景故事承接于《复仇者联盟2：奥创纪元》事件的余波中，讲述了奥创事件后引发的一系列政治问题导致复仇者之间内部矛盾激化的故事[1]  。', '1', '0', '0', '2016-05-11 19:20:25', '0');INSERT INTO `t_goods` VALUES ('4', 'q', '3.png', '7', '0', '1', 'q', 'q', '23', '0', '0', '0', '2016-05-11 19:53:43', '0');INSERT INTO `t_goods` VALUES ('5', '11', 'C:\\fakepath\\软件1311（修改版4.14-1）.doc', '0', '0', '4', '', '', '', '0', '0', '0', '2016-05-25 15:42:05', '0');
