-- ------------------------------ Table structure for ums_user-- ----------------------------DROP TABLE IF EXISTS `ums_user`;CREATE TABLE `ums_user` (  `id` char(32) NOT NULL DEFAULT '' COMMENT '主键(UUID)',  `username` varchar(30) DEFAULT NULL COMMENT '用户名',  `password` varchar(100) DEFAULT NULL COMMENT '密码',  `salt` varchar(100) DEFAULT NULL COMMENT '盐',  `phone` varchar(20) DEFAULT NULL COMMENT '手机号码',  `email` varchar(100) DEFAULT NULL COMMENT '邮箱',  `realName` varchar(30) DEFAULT NULL COMMENT '真实姓名',  `sex` tinyint(4) DEFAULT '0' COMMENT '性别  0：男  1：女',  `idCard` varchar(30) DEFAULT NULL COMMENT '身份证号码',  `is_super_admin` tinyint(4) DEFAULT '0' COMMENT '是否超管：0 否  1：是',  `password_changed` tinyint(4) DEFAULT '0' COMMENT '是否首次登录修改密码0否 1是',  `last_login_time` datetime DEFAULT NULL COMMENT '最后登录时间',  `status` tinyint(4) NOT NULL DEFAULT '1' COMMENT '状态   0:失效  1:有效  ',  `date_effect` datetime DEFAULT NULL COMMENT '生效时间',  `date_expire` datetime DEFAULT NULL COMMENT '失效时间',  `date_create` datetime DEFAULT NULL COMMENT '创建时间',  `date_update` datetime DEFAULT NULL COMMENT '修改时间',  `creator_fk` varchar(45) DEFAULT NULL COMMENT '创建人',  `updater_fk` varchar(45) DEFAULT NULL COMMENT '更新人',  PRIMARY KEY (`id`)) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='系统用户表';
